{
  "extends": [
    "@commitlint/config-conventional"
  ]
}

{
  "**/*.{ts,tsx,js,jsx,md,mdx}": ["prettier --write"]
}

{
  "$schema": "https://docs.renovatebot.com/renovate-schema.json",
  "dependencyDashboard": false,
  "extends": ["config:base", "schedule:earlyMondays"],
  "labels": ["dependencies"],
  "rebaseWhen": "conflicted",
  "timezone": "UTC",
  "packageRules": [
    {
      "description": "Automatically merge minor and patch-level updates",
      "matchUpdateTypes": ["minor", "patch", "digest"],
      "automerge": true,
      "automergeType": "branch"
    },
    {
      "groupName": "react",
      "matchPackageNames": ["react", "react-dom"]
    },
    {
      "groupName": "eslint",
      "matchPackagePatterns": ["eslint*"]
    },
    {
      "groupName": "storybook",
      "matchPackagePatterns": ["@storybook*"]
    },
    {
      "groupName": "changesets",
      "matchPackagePatterns": ["@changesets*"]
    },
    {
      "groupName": "babel",
      "matchPackagePatterns": ["@babel*"]
    },
    {
      "groupName": "panda",
      "matchPackagePatterns": ["@pandacss/*"]
    }
  ]
}

{
  "compilerOptions": {
    // Enable latest features
    "lib": ["DOM", "ESNext"],
    "target": "ESNext",
    "module": "ESNext",
    "moduleDetection": "force",
    "allowJs": true,

    // Bundler mode
    "moduleResolution": "bundler",
    "allowImportingTsExtensions": true,
    "verbatimModuleSyntax": true,
    "noEmit": true,
    "customConditions": ["source"],

    // JSX
    "jsx": "react-jsx",

    // Best practices
    "strict": true,
    "skipLibCheck": true,
    "noFallthroughCasesInSwitch": true,
    "noUnusedLocals": true,
    "noUnusedParameters": true,
    "types": ["node", "vitest/globals"]
  }
}

{
  "extends": ["./tsconfig.build.json"],
  "include": ["vitest.setup.ts", "packages", "apps/compositions"],
  "compilerOptions": {
    "paths": {
      "compositions/*": ["./apps/compositions/src/*"]
    }
  }
}

/// <reference types="vitest" />
import { resolve } from "path"
import { defineConfig } from "vite"

export default defineConfig({
  resolve: {
    alias: {
      "@chakra-ui/react": resolve("packages/react/src"),
      compositions: resolve("apps/compositions/src"),
    },
  },
  test: {
    globals: true,
    watch: false,
    environment: "jsdom",
    include: ["**/*test.{ts,tsx}"],
    setupFiles: ["vitest.setup.ts"],
    coverage: {
      include: ["packages"],
    },
  },
})

import "@testing-library/jest-dom/vitest"
import { expect } from "vitest"
import "vitest-axe/extend-expect"
import * as matchers from "vitest-axe/matchers"

expect.extend(matchers)

const { getComputedStyle } = window
window.getComputedStyle = (elt) => getComputedStyle(elt)
window.Element.prototype.scrollTo = () => {}
window.scrollTo = () => {}

if (typeof window.matchMedia !== "function") {
  Object.defineProperty(window, "matchMedia", {
    enumerable: true,
    configurable: true,
    writable: true,
    value: vi.fn().mockImplementation((query) => ({
      matches: false,
      media: query,
      onchange: null,
      addListener: vi.fn(), // Deprecated
      removeListener: vi.fn(), // Deprecated
      addEventListener: vi.fn(),
      removeEventListener: vi.fn(),
      dispatchEvent: vi.fn(),
    })),
  })
}

// Workaround https://github.com/jsdom/jsdom/issues/2524#issuecomment-897707183
global.TextEncoder = require("util").TextEncoder

global.ResizeObserver = vi.fn().mockImplementation(() => ({
  observe: vi.fn(),
  unobserve: vi.fn(),
  disconnect: vi.fn(),
}))

window.HTMLCanvasElement.prototype.getContext = vi
  .fn()
  .mockImplementation(() => ({}))
